import { createRouter } from '@tanstack/react-router';
import Form from '../components/Form'; // Sprawdź, czy ścieżka do Form jest poprawna
import Table from '../components/Table'; // Sprawdź, czy ścieżka do Table jest poprawna

// Stworzenie routingu
export const router = createRouter({
  routeTree: [
    {
      path: '/form',
      element: <Form />,
    },
    {
      path: '/table',
      element: <Table />,
    },
  ],
});
